import React , {Fragment} from 'react'
import AvaliableMeals from './AvaliableMeals';
import MealsSummary from './MealsSummary';

const Meals = () => {
  return (
    <Fragment>
    
      <MealsSummary/>
      <AvaliableMeals/>
      
    </Fragment>
  )
}

export default Meals;
